import React from 'react'
import { Card as UI_Card, CardContent } from "@/components/ui/card"

const DestinationCard = () => {
    const destinations = [
        {
          title: "Mount Everest Base Camp",
          description: "Experience the majesty of the world's highest peak with our guided trek to Everest Base Camp.",
          imageUrl: "/placeholder.svg?height=400&width=600",
          price: "1299"
        },
        {
          title: "Annapurna Circuit",
          description: "Trek through diverse landscapes and traditional villages in the Annapurna region.",
          imageUrl: "/placeholder.svg?height=400&width=600",
          price: "999"
        },
        {
          title: "Langtang Valley",
          description: "Discover the beautiful Langtang region with its stunning mountain views and rich culture.",
          imageUrl: "/placeholder.svg?height=400&width=600",
          price: "899"
        }
    ]
  
    return (
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
            {destinations.map((destination, index) => (
                <UI_Card key={index} className="overflow-hidden transition-transform hover:scale-[1.02] duration-300">
                    <div className="relative h-64">
                        <img 
                          src={destination.imageUrl} 
                          alt={destination.title}
                          className="w-full h-full object-cover"
                        />
                    </div>
                    <CardContent className="p-6 bg-white">
                        <div className="space-y-4">
                            <div>
                                <h3 className="text-xl font-semibold text-gray-900">{destination.title}</h3>
                                <p className="mt-2 text-gray-600 line-clamp-2">{destination.description}</p>
                            </div>
                            {destination.price && (
                                <div className="flex justify-between items-center">
                                    <span className="text-lg font-semibold text-[#1a1147]">
                                        Starting from ${destination.price}
                                    </span>
                                    <button className="px-4 py-2 bg-[#1a1147] text-white rounded-lg hover:bg-[#2a1b67] transition-colors">
                                        Book Now
                                    </button>
                                </div>
                            )}
                        </div>
                    </CardContent>
                </UI_Card>
            ))}
        </div>
    )
}

export default DestinationCard;
